CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY , "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY , "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY , "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY , "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY , "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "custom_user_groups" ("id" integer NOT NULL PRIMARY KEY , "customuser_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "custom_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY , "customuser_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "mentalhealth_relaxationlog" ("id" integer NOT NULL PRIMARY KEY , "exercise_type" varchar(100) NOT NULL, "duration_seconds" integer unsigned NOT NULL CHECK ("duration_seconds" >= 0), "timestamp" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "mentalhealth_dassresult" ("id" integer NOT NULL PRIMARY KEY , "date_taken" datetime NOT NULL, "depression_score" integer NOT NULL, "anxiety_score" integer NOT NULL, "stress_score" integer NOT NULL, "depression_severity" varchar(50) NOT NULL, "anxiety_severity" varchar(50) NOT NULL, "answers" text NOT NULL CHECK ((JSON_VALID("answers") OR "answers" IS NULL)), "user_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "stress_severity" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY , "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "custom_user" ("id" integer NOT NULL PRIMARY KEY , "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "email_verified" bool NOT NULL, "verification_token" varchar(64) NULL, "student_id" varchar(20) NOT NULL UNIQUE, "age" integer unsigned NULL CHECK ("age" >= 0), "full_name" varchar(255) NOT NULL, "gender" varchar(20) NOT NULL, "college" varchar(10) NOT NULL, "program" varchar(255) NOT NULL, "year_level" varchar(2) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "profile_picture" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "mentalhealth_report" ("id" integer NOT NULL PRIMARY KEY , "title" varchar(200) NOT NULL, "description" text NOT NULL, "report_type" varchar(20) NOT NULL, "status" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "counselor_id" bigint NOT NULL REFERENCES "mentalhealth_counselor" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "appointment_id" bigint NULL REFERENCES "mentalhealth_appointment" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "mentalhealth_counselor" ("id" integer NOT NULL PRIMARY KEY , "name" varchar(100) NOT NULL, "unit" varchar(100) NOT NULL, "rank" varchar(100) NOT NULL, "bio" text NOT NULL, "image" varchar(100) NULL, "available_days" text NOT NULL CHECK ((JSON_VALID("available_days") OR "available_days" IS NULL)), "is_active" bool NOT NULL, "email" varchar(254) NULL, "user_id" bigint NULL UNIQUE REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "available_end_time" time NULL, "available_start_time" time NULL, "day_schedules" text NOT NULL CHECK ((JSON_VALID("day_schedules") OR "day_schedules" IS NULL)));
CREATE TABLE IF NOT EXISTS "mentalhealth_feedback" ("id" integer NOT NULL PRIMARY KEY , "overall_rating" integer NULL, "professionalism_rating" integer NULL, "helpfulness_rating" integer NULL, "recommend_rating" integer NULL, "positive_feedback" text NOT NULL, "improvement_feedback" text NOT NULL, "additional_comments" text NOT NULL, "submitted_at" datetime NOT NULL, "skipped" bool NOT NULL, "appointment_id" bigint NOT NULL REFERENCES "mentalhealth_appointment" ("id") DEFERRABLE INITIALLY DEFERRED, "counselor_id" bigint NOT NULL REFERENCES "mentalhealth_counselor" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "mentalhealth_appointment" ("id" integer NOT NULL PRIMARY KEY , "date" date NOT NULL, "time" time NOT NULL, "services" text NOT NULL CHECK ((JSON_VALID("services") OR "services" IS NULL)), "reason" text NOT NULL, "phone" varchar(20) NOT NULL, "course_section" varchar(100) NOT NULL, "status" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "cancellation_deadline" datetime NULL, "cancellation_reason" text NOT NULL, "cancellation_token" varchar(64) NULL UNIQUE, "user_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "counselor_id" bigint NOT NULL REFERENCES "mentalhealth_counselor" ("id") DEFERRABLE INITIALLY DEFERRED, "dass_result_id" bigint NULL REFERENCES "mentalhealth_dassresult" ("id") DEFERRABLE INITIALLY DEFERRED, "cancelled_at" datetime NULL, "notes" text NULL, "session_type" varchar(20) NOT NULL, "video_call_url" varchar(200) NULL);
CREATE TABLE IF NOT EXISTS "mentalhealth_livesession" ("id" integer NOT NULL PRIMARY KEY , "session_type" varchar(20) NOT NULL, "status" varchar(20) NOT NULL, "room_id" varchar(100) NOT NULL UNIQUE, "session_token" varchar(255) NOT NULL, "meeting_url" varchar(200) NOT NULL, "scheduled_start" datetime NOT NULL, "scheduled_end" datetime NOT NULL, "actual_start" datetime NULL, "actual_end" datetime NULL, "notes" text NOT NULL, "recording_url" varchar(200) NOT NULL, "session_data" text NOT NULL CHECK ((JSON_VALID("session_data") OR "session_data" IS NULL)), "is_recorded" bool NOT NULL, "consent_given" bool NOT NULL, "privacy_level" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "appointment_id" bigint NOT NULL UNIQUE REFERENCES "mentalhealth_appointment" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "mentalhealth_sessionmessage" ("id" integer NOT NULL PRIMARY KEY , "message" text NOT NULL, "message_type" varchar(20) NOT NULL, "timestamp" datetime NOT NULL, "sender_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "session_id" bigint NOT NULL REFERENCES "mentalhealth_livesession" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "mentalhealth_sessionparticipant" ("id" integer NOT NULL PRIMARY KEY , "role" varchar(20) NOT NULL, "joined_at" datetime NOT NULL, "left_at" datetime NULL, "connection_quality" varchar(20) NOT NULL, "session_id" bigint NOT NULL REFERENCES "mentalhealth_livesession" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "mentalhealth_notification" ("id" integer NOT NULL PRIMARY KEY , "message" text NOT NULL, "type" varchar(20) NOT NULL, "url" varchar(255) NULL, "created_at" datetime NOT NULL, "read" bool NOT NULL, "dismissed" bool NOT NULL, "user_id" bigint NOT NULL REFERENCES "custom_user" ("id") DEFERRABLE INITIALLY DEFERRED, "priority" varchar(10) NOT NULL, "category" varchar(20) NOT NULL, "action_url" varchar(200) NULL, "action_text" varchar(50) NULL, "expires_at" datetime NULL, "metadata" text NOT NULL CHECK ((JSON_VALID("metadata") OR "metadata" IS NULL)));
